import React from 'react';
import './App.css';
import Home from './Home/Home';
import Produit from './Produits/Produit';
import Shop from './Shop/Shop';
import {BrowserRouter as Router,Route,Link} from 'react-router-dom';
function App(){
  return(
    <Router>
    <div className='container'>
      <nav className="navbar navbar-expand-lg bg-primary">
  <div className="container-fluid">
    <link className="navbar-brand text-light" to="">MG-CODE</link>
    <div className="collapse navbar-collapse" id="navbarNav">
      <ul className="navbar-nav">
        <li className="nav-item">
          <link className="nav-link active text-light" to="/">Home</link>
        </li>
        <li className="nav-item">
          <link className="nav-link text-light" to="/Produit">Produits</link>
        </li>
        <li className="nav-item">
          <link className="nav-link text-light" to="/Shop">Shope</link>
        </li>
      </ul>
    </div>
  </div>
</nav>
<Route path='/' component={Home}/>
<Route path='/Produit' component={Produit}/>
<Route path='/Shop' component={Shop}/>
    </div>
    </Router>
  );
}
export default App;
